function updateIcon(active) {
  if (active) chrome.action.setIcon({ path: `images/icon.png` });
  else chrome.action.setIcon({ path: `images/icon-inactive.png` });
}

function getGenus(word) {
  if(word.toLowerCase() in genus)
    return genus[word.toLowerCase()][0];
  return "?";
}

function updateIconColor(word) {
  let genus = getGenus(word);
  switch (genus) {
    case "m":
      chrome.action.setIcon({ path: `images/blue.png` });
      break;
    case "f":
      chrome.action.setIcon({ path: `images/red.png` });
      break;
    case "n":
      chrome.action.setIcon({ path: `images/yellow.png` });
      break;
    default:
      chrome.action.setIcon({ path: `images/unknown.png` });
  }
}

chrome.runtime.onMessage.addListener((request, sender, sendResponse) => {
  console.log(request);
  if (request.message === "search_word") {
    updateIconColor(request.word);
  }

  if (chrome.runtime.lastError) {
    sendResponse({
      message: "fail",
    });
    return;
  }

  sendResponse({
    message: "success",
  });
  return true;
});

chrome.storage.onChanged.addListener((changes, areaName) => {
  if("active" in changes){
    if (changes["active"]["newValue"] != changes["active"]["oldValue"]){
      let active = changes["active"]["newValue"];
      updateIcon(active);
    }
  }
});

chrome.runtime.onInstalled.addListener((reason) => {
  chrome.storage.local.set({active: true});
  updateIcon(true);
});
